import React from 'react';
import PropTypes from 'prop-types';

function Input(props) {
  const {
    classDiv,
    classInput,
    dataTestid,
    id,
    label,
    name,
    onChange,
    placeholder,
    value,
    type,
  } = props;

  return (
    <div className={ classDiv }>
      <label htmlFor={ id }>
        {label}
        <input
          className={ classInput }
          data-testid={ dataTestid }
          id={ id }
          name={ name }
          onChange={ onChange }
          placeholder={ placeholder }
          value={ value }
          type={ type }
        />
      </label>
    </div>
  );
}

